import '../styles/Global.css';
import { Link } from "react-router-dom";
import { RegisteredNavbar } from '../components/RegisteredNavbarNavbar';
import { Footer } from '../components/Footer';
export function Dashboard (){
    return (
        <div className="dashboard">
            <div >
                <h1>Welcome User</h1> 
                <Link to = "/courses" className='dashboard_link'>Courses</Link>             
            </div>
            <Footer/>
        </div>
    )
}
